import ReactDOM from 'react-dom/client'
const root=ReactDOM.createRoot(document.getElementById('root'))
var date=new Date()
let h=date.getHours
let result
if(h<12){
    result="Good morning"
}else if(h>12 && h<17){
    result="Good Afternoon"
}else if(h>17 && h<24){
    result="Good Afternoon"
}
root.render(
    <>
    <h2>Variables</h2>
    <h3>{result}</h3>
    </>
)
